///SOLD///
!966 Colt Python With Factory original box, numbered to the gun, paper work and test target.  This is a very nice Colt for the collector that likes to shoot his guns.  Gun rates 97% with slight holster wear at the muzzle and a "very" small amount of silvering on the sharp edges of the cylinder.  The gun has been very well maintained, locks up tight and shoots like it should!  The minimal wear is what I would call pleasing wear no ugly scratches, nicks, dings etc.    

Serious inquires only please
